import React, { useEffect, useRef, useState } from 'react';
import io from 'socket.io-client';

const socket = io('http://localhost:5000');

const Room = () => {
  const [roomCode, setRoomCode] = useState('');
  const [userName, setUserName] = useState('');
  const [joined, setJoined] = useState(false);
  const [participants, setParticipants] = useState([]);
  const [videoDevices, setVideoDevices] = useState([]);
  const [selectedDeviceId, setSelectedDeviceId] = useState(null);
  const localVideoRef = useRef(null);
  const localStream = useRef(null);

  useEffect(() => {
    navigator.mediaDevices.enumerateDevices().then(devices => {
      const cameras = devices.filter(device => device.kind === 'videoinput');
      setVideoDevices(cameras);
      if (cameras.length > 0) {
        setSelectedDeviceId(cameras[0].deviceId);
      }
    });
  }, []);

  useEffect(() => {
    if (selectedDeviceId) {
      navigator.mediaDevices
        .getUserMedia({ video: { deviceId: selectedDeviceId }, audio: true })
        .then(stream => {
          localStream.current = stream;
          if (localVideoRef.current) {
            localVideoRef.current.srcObject = stream;
          }
        });
    }
  }, [selectedDeviceId]);

  useEffect(() => {
    socket.on('user-joined', ({ name }) => {
      setParticipants(prev => [...prev, name]);
    });
    return () => {
      socket.off('user-joined');
    };
  }, []);

  const handleJoin = () => {
    if (!roomCode || !userName) return alert('Enter room and name');
    setJoined(true);
    socket.emit('join-room', { room: roomCode, name: userName });
    setParticipants(prev => [...prev, userName]);
  };

  return (
    <div className="flex flex-col min-h-screen p-4 bg-gray-100">
      {!joined ? (
        <div className="max-w-md mx-auto mt-20 p-6 bg-white rounded shadow">
          <h2 className="text-xl font-bold mb-4 text-center">Join Ve Meet</h2>
          <input
            className="w-full mb-3 p-2 border rounded"
            placeholder="Enter Room Code"
            value={roomCode}
            onChange={e => setRoomCode(e.target.value)}
          />
          <input
            className="w-full mb-3 p-2 border rounded"
            placeholder="Enter Your Name"
            value={userName}
            onChange={e => setUserName(e.target.value)}
          />
          <div className="mb-3">
            <label className="block mb-1 font-medium">Camera:</label>
            <select
              className="w-full p-2 border rounded"
              value={selectedDeviceId || ''}
              onChange={e => setSelectedDeviceId(e.target.value)}>
              {videoDevices.map(device => (
                <option key={device.deviceId} value={device.deviceId}>
                  {device.label || 'Camera'}
                </option>
              ))}
            </select>
          </div>
          <button
            onClick={handleJoin}
            className="w-full bg-blue-600 text-white py-2 rounded hover:bg-blue-700">
            Join Now
          </button>
        </div>
      ) : (
        <div className="flex flex-col lg:flex-row gap-4">
          <div className="flex-1 bg-white rounded shadow p-4">
            <div className="flex justify-between items-center mb-4">
              <div>
                <h2 className="text-xl font-semibold">Room: {roomCode}</h2>
                <p className="text-gray-600">You: {userName}</p>
              </div>
            </div>
            <video
              className="w-full rounded border"
              ref={localVideoRef}
              autoPlay
              muted
              playsInline
            />
          </div>

          <div className="w-full lg:w-1/4 bg-white rounded shadow p-4">
            <h3 className="text-lg font-bold mb-2">Participants</h3>
            <ul className="space-y-1">
              {participants.map((name, i) => (
                <li key={i} className="border-b py-1 text-gray-800">
                  {name}
                </li>
              ))}
            </ul>
          </div>
        </div>
      )}
    </div>
  );
};

export default Room;
